import {routes} from '../datas/Routes.js';


function NavBar() {

    const listItems = routes.map(item =>
        <li key={item.id}>
            <a href={item.href}>{item.title}</a>
        </li>
    )
    return (
        <nav className="hidden lg:flex item-center content-center">
            <ul className="flex flex-col lg:flex-row item-center content-center gap-x-8 text-base font-amstelvar">
                {listItems}
            </ul>
        </nav>
    )
}

export default NavBar;
